import React from "react";
import { WeatherSvg } from "weather-icons-animated";

export default function WeatherIcon(props) {
  const codeMapping = {
    "clear-sky-day": "sunny",
  };
  return <WeatherSvg state={codeMapping[props.icon]} width="100" />;
}
